import './App.css';
import {BrowserRouter as Router, Link, Route} from 'react-router-dom'; 

//components
import Navbar from './components/Navbar/Navbar.js';
//import Footer from './components/Footer/Footer.js';
//import Carrousel from './components/Carrousel/Carrousel.js';
import Gallery from './components/Gallery/Gallery.js';
import FadeCarrousel from './components/FadeCarrousel/FadeCarrousel';
//import MouseCursor from './components/MouseCursor/MouseCursor';
//import ProjectCover from './components/ProjectCover/ProjectCover';
import ProjectCover2 from './components/ProjectCover2/ProjectCover2';
import Footer from './components/Footer/Footer';
//import ProjectCover3 from './components/ProjectCover3/ProjectCover3';

function App() {

  const Home = () => (

    <div>
    <p>home</p>
    <FadeCarrousel/>
    </div>

  )

  const Work = () => (
    <div><p>Work</p></div>
  )

  const Contact = () => (
    <div><p>Work</p></div>
  )

  return (
    <div className="App">
    <Router>
       <Route exact path='/home' component={Home} />
       <Route exact path='/about' component={Work} />
       <Route exact path='/contact' component={Contact} />
    </Router>

    </div>
  );
}

export default App;
